import idReducer from './Model/jokeSlice';
import titleReducer from './Model/titleJokeSlice';
const { configureStore } = require("@reduxjs/toolkit");

const rootReducer ={
    ids: idReducer,
    titleJokes: titleReducer,
}

const store = configureStore({
    reducer: rootReducer,
})

export default store;
